    "contracts/MBAA.sol": {
      "content": "// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.9;

// Uncomment this line to use console.log
// import "hardhat/console.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/IERC20Metadata.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Burnable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@uniswap/v2-core/contracts/interfaces/IUniswapV2Factory.sol";
import "@uniswap/v2-core/contracts/interfaces/IUniswapV2Pair.sol";
import "@uniswap/v2-periphery/contracts/interfaces/IUniswapV2Router02.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

contract MBAA is IERC20, IERC20Metadata, Ownable {
    using SafeMath for uint256;

    mapping(address => uint256) private _balances;

    mapping(address => mapping(address => uint256)) private _allowances;

    uint256 private _totalSupply;

    string private _name = "MBAA";
    string private _symbol = "MBAA";

    mapping(address => bool) public pairs;

    mapping(address => bool) public mbaaSwapPairs;

    mapping(address => bool) public excludeFee;

    mapping(address => bool) public excludeFeeOnMbaa;
    address public mainPair;
    address public otherTokenAddress;

    address public mbaaMainPair;
    address public mbaaOtherTokenAddress;

    uint public pancakeSwapBuyFee = 1;
    uint public pancakeSwapSellFee = 1;
    address public feeReceiver;

    // addLiquity  on mbaaSwap
    uint public mbaaSwapBuyFee = 99;
    uint public mbaaSwapBuyFee1 = 1;
    uint public mbaaSwapSellFee = 99;
    uint public mbaaSwapSellFee1 = 1;
    address public mbaaSwapFeeReceiver;

    uint public totalFee;

    mapping(address => bool) public deadAddress;

    constructor(
        uint256 _maxSupply,
        address _usdtAddress,
        address _iUniswapV2Router02Add,
        address _feeReceiver,
        address _iMbaaswapRouter02Add,
        address _mbaaSwapFeeReceiver
    ) {
        IUniswapV2Router02 iUniswapV2Router02 = IUniswapV2Router02(
            _iUniswapV2Router02Add
        );
        IUniswapV2Factory iUniswapV2Factory = IUniswapV2Factory(
            iUniswapV2Router02.factory()
        );
        address pair1 = iUniswapV2Factory.createPair(
            address(this),
            iUniswapV2Router02.WETH()
        );
        // token1 = MBAS , token2 = USDT
        address pair2 = iUniswapV2Factory.createPair(
            address(this),
            _usdtAddress
        );
        mainPair = pair2;
        otherTokenAddress = _usdtAddress;
        pairs[pair1] = true;
        pairs[pair2] = true;

        feeReceiver = _feeReceiver;

        IUniswapV2Router02 iMbaaswapRouter02 = IUniswapV2Router02(
            _iMbaaswapRouter02Add
        );
        address pair3 = IUniswapV2Factory(iMbaaswapRouter02.factory())
            .createPair(address(this), _usdtAddress);
        mbaaSwapPairs[pair3] = true;
        mbaaMainPair = pair3;
        mbaaOtherTokenAddress = _usdtAddress;

        mbaaSwapFeeReceiver = _mbaaSwapFeeReceiver;

        excludeFee[_msgSender()] = true;
        deadAddress[0x000000000000000000000000000000000000dEaD] = true;
        _mint(msg.sender, _maxSupply * 10 ** decimals());
    }

    function setPair(address _pair, bool _state) public onlyOwner {
        require(_pair != address(0), "ERROR:ZERO_ADDRESS");
        pairs[_pair] = _state;
    }

    function setPairOnMbaa(address _pair, bool _state) public onlyOwner {
        require(_pair != address(0), "ERROR:ZERO_ADDRESS");
        mbaaSwapPairs[_pair] = _state;
    }

    function setExcludeFee(address _address, bool _state) public onlyOwner {
        require(_address != address(0), "ERROR:ZERO_ADDRESS");
        excludeFee[_address] = _state;
    }

    function setExcludeFeeOnMbaa(
        address _address,
        bool _state
    ) public onlyOwner {
        require(_address != address(0), "ERROR:ZERO_ADDRESS");
        excludeFeeOnMbaa[_address] = _state;
    }

    function setMainPair(address _mainPair) public onlyOwner {
        mainPair = _mainPair;
    }

    function setOtherTokenAddress(address _otherTokenAddress) public onlyOwner {
        otherTokenAddress = _otherTokenAddress;
    }

    function setMbaaMainPair(address _mbaaMainPair) public onlyOwner {
        mbaaMainPair = _mbaaMainPair;
    }

    function setMbaaOtherTokenAddress(
        address _mbaaOtherTokenAddress
    ) public onlyOwner {
        mbaaOtherTokenAddress = _mbaaOtherTokenAddress;
    }

    function setPancakeBuyFee(uint _buyFee) public onlyOwner {
        pancakeSwapBuyFee = _buyFee;
    }

    function setPancakeSellFee(uint _sellFee) public onlyOwner {
        pancakeSwapSellFee = _sellFee;
    }

    function setFeeReceiver(address _feeReceiver) public onlyOwner {
        feeReceiver = _feeReceiver;
    }

    function setMbaaBuyFee(uint _buyFee) public onlyOwner {
        mbaaSwapBuyFee = _buyFee;
    }

    function setMbaaSellFee(uint _sellFee) public onlyOwner {
        mbaaSwapSellFee = _sellFee;
    }

    function setMbaaBuyFee1(uint _buyFee) public onlyOwner {
        mbaaSwapBuyFee1 = _buyFee;
    }

    function setMbaaSellFee1(uint _sellFee) public onlyOwner {
        mbaaSwapSellFee1 = _sellFee;
    }

    function setMbaaFeeReceiver(address _feeReceiver) public onlyOwner {
        mbaaSwapFeeReceiver = _feeReceiver;
    }

    /**
     * @dev Moves `amount` of tokens from `from` to `to`.
     *
     * This internal function is equivalent to {transfer}, and can be used to
     * e.g. implement automatic token fees, slashing mechanisms, etc.
     *
     * Emits a {Transfer} event.
     *
     * Requirements:
     *
     * - `from` cannot be the zero address.
     * - `to` cannot be the zero address.
     * - `from` must have a balance of at least `amount`.
     */
    function _transfer(address from, address to, uint256 amount) internal {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");

        _beforeTokenTransfer(from, to, amount);

        uint256 fromBalance = _balances[from];
        require(
            fromBalance >= amount,
            "ERC20: transfer amount exceeds balance"
        );

        bool isSwapOnPancake = pairs[from] || pairs[to];

        bool isSwapOnMbaa = mbaaSwapPairs[from] || mbaaSwapPairs[to];

        if (isSwapOnPancake || isSwapOnMbaa) {
            if (isSwapOnPancake) {
                if (excludeFee[from] || excludeFee[to]) {
                    // whiteList
                    _standardTransfer(from, to, amount);
                    return;
                }
                if (pairs[from]) {
                    if (_isRemoveLiquidity()) {
                        _standardTransfer(from, to, amount);
                        _afterTokenTransfer(from, to, amount);
                        return;
                    }
                }
                if (pairs[to]) {
                    if (_isAddLiquidity()) {
                        _standardTransfer(from, to, amount);
                        _afterTokenTransfer(from, to, amount);
                        return;
                    }
                }
                _transferWithFee(from, to, amount);
                return;
            } else {
                if (mbaaSwapPairs[from]) {
                    if (_isRemoveLiquidityOnMbaa()) {
                        _standardTransfer(from, to, amount);
                        _afterTokenTransfer(from, to, amount);
                        return;
                    }
                }
                if (mbaaSwapPairs[to]) {
                    if (_isAddLiquidityOnMbaa()) {
                        _standardTransfer(from, to, amount);
                        _afterTokenTransfer(from, to, amount);
                        return;
                    }
                }
                _transferWithFeeOnMbaa(from, to, amount);
                _afterTokenTransfer(from, to, amount);
                return;
            }
        } else {
            // normal transfer
            if (deadAddress[to]) {
                _burn(from, amount);
            } else {
                _standardTransfer(from, to, amount);
            }
        }

        _afterTokenTransfer(from, to, amount);
    }

    function _standardTransfer(
        address from,
        address to,
        uint256 amount
    ) internal {
        _balances[from] -= amount;
        _balances[to] += amount;
        emit Transfer(from, to, amount);
    }

    function _transferWithFee(
        address from,
        address to,
        uint256 amount
    ) internal {
        if (pairs[from]) {
            //buy
            uint256 buyFeeAmount = amount.mul(pancakeSwapBuyFee).div(100);
            totalFee += buyFeeAmount;
            uint256 tAmount = amount.sub(buyFeeAmount);
            _balances[from] -= amount;
            _balances[to] += tAmount;
            emit Transfer(from, to, tAmount);
            _balances[feeReceiver] += buyFeeAmount;
            emit Transfer(from, feeReceiver, buyFeeAmount);
        } else {
            //sell
            uint256 sellFeeAmount = amount.mul(pancakeSwapSellFee).div(100);
            totalFee += sellFeeAmount;
            uint256 tAmount = amount.sub(sellFeeAmount);
            _balances[from] -= amount;
            _balances[to] += tAmount;
            emit Transfer(from, to, tAmount);
            _balances[feeReceiver] += sellFeeAmount;
            emit Transfer(from, feeReceiver, sellFeeAmount);
        }
    }

    function _transferWithFeeOnMbaa(
        address from,
        address to,
        uint256 amount
    ) internal {
        if (mbaaSwapPairs[from]) {
            //buy
            uint256 buyFeeAmount;
            if (excludeFeeOnMbaa[to]) {
                buyFeeAmount = amount.mul(mbaaSwapBuyFee1).div(100);
            } else {
                buyFeeAmount = amount.mul(mbaaSwapBuyFee).div(100);
            }
            totalFee += buyFeeAmount;
            uint256 tAmount = amount.sub(buyFeeAmount);
            _balances[from] -= amount;
            _balances[to] += tAmount;
            emit Transfer(from, to, tAmount);
            _balances[mbaaSwapFeeReceiver] += buyFeeAmount;
            emit Transfer(from, mbaaSwapFeeReceiver, buyFeeAmount);
        } else {
            //sell
            uint256 sellFeeAmount;
            if (excludeFeeOnMbaa[from]) {
                sellFeeAmount = amount.mul(mbaaSwapSellFee1).div(100);
            } else {
                sellFeeAmount = amount.mul(mbaaSwapSellFee).div(100);
            }
            totalFee += sellFeeAmount;
            uint256 tAmount = amount.sub(sellFeeAmount);
            _balances[from] -= amount;
            _balances[to] += tAmount;
            emit Transfer(from, to, tAmount);
            _balances[mbaaSwapFeeReceiver] += sellFeeAmount;
            emit Transfer(from, mbaaSwapFeeReceiver, sellFeeAmount);
        }
    }

    function _isAddLiquidity() internal view returns (bool isAdd) {
        IUniswapV2Pair pair = IUniswapV2Pair(mainPair);
        (uint r0, uint256 r1, ) = pair.getReserves();

        address tokenOther = otherTokenAddress;
        uint256 r;
        if (tokenOther < address(this)) {
            r = r0;
        } else {
            r = r1;
        }
        uint bal = IERC20(tokenOther).balanceOf(address(mainPair));
        isAdd = bal > r;
    }

